/** 
 * Create a worker pool to enable an array of  {@link WorkHandler}s to consume published sequences. This option requires a pre-configured  {@link RingBuffer} which must have {@link RingBuffer#addGatingSequences(Sequence...)}called before the work pool is started.
 * @param ringBuffer of events to be consumed.
 * @param sequenceBarrier on which the workers will depend.
 * @param exceptionHandler to callback when an error occurs which is not handled by the {@link WorkHandler}s.
 * @param workHandlers to distribute the work load across.
 */
public WorkerPool(final RingBuffer<T> ringBuffer,final SequenceBarrier sequenceBarrier,final ExceptionHandler exceptionHandler,final WorkHandler<T>... workHandlers){
  this.ringBuffer=ringBuffer;
  final int numWorkers=workHandlers.length;
  workProcessors=new WorkProcessor[numWorkers];
  for (int i=0; i < numWorkers; i++) {
    workProcessors[i]=new WorkProcessor<T>(ringBuffer,sequenceBarrier,workHandlers[i],exceptionHandler,workSequence);
  }
}

